import React from "react";
import NavBar from "./navbar";
import issues from './data';
import Background from "./background.jpg";
import red from "./red.png";
import green from "./green.png"

class Overview extends React.Component {
    constructor(props) {
        super(props);

        this.handleClick = this.handleClick.bind(this);
    }

    handleClick(event) {
        window.alert(Date.parse(new Date().getFullYear()+"-0"+(new Date().getMonth()+1)+"-"+
            new Date().getDate()+"T"+new Date().getHours()+":"+new Date().getMinutes()+":"+
            new Date().getSeconds()+"+02:00"));
        this.props.history.push('/');
    }

    render() {
        return (
            <div className="overview">
                <div className="navBar">
                <NavBar />
                </div>
                <div className="register_box" >
                    <h2 className="text-center text-white">Oversikt</h2>
                    <br></br>
                    <table className="table table-dark" >
                        <thead>
                        <tr>
                            <th scope="col">Status</th>
                            <th scope="col">#</th>
                            <th scope="col">Melding</th>
                            <th scope="col">Gyldighet</th>
                            <th scope="col">Type</th>
                        </tr>
                        </thead>
                        <tbody>
                        {issues.ServiceDelivery.SituationExchangeDelivery.Situations.PtSituationElement.map((item, key) => (
                            <tr>
                                <th>{(Date.parse(item.ValidityPeriod.EndTime) > Date.parse(new Date().getFullYear()+"-0"+(new Date().getMonth()+1)+"-"+
                                    new Date().getDate()+"T"+new Date().getHours()+":"+new Date().getMinutes()+":"+
                                    new Date().getSeconds()+"+02:00")) ?
                                    <img src={ red } alt="" height="30" width="30" /> : <img src={ green } alt="" height="30" width="30" />}</th>
                                <th>{item.SituationNumber}</th>
                                <td>{item.Summary['@Value']}</td>
                                <td>{item.ValidityPeriod.StartTime} til {item.ValidityPeriod.EndTime}</td>
                                <td>Ikke gjort enda</td>
                            </tr>
                        ))}
                        </tbody>
                    </table>
                    <button onClick={this.handleClick} type="submit" className="btn btn-warning btn-lg btn-block">Tilbake</button>
                </div>
            </div>
        );
    }
}

export default Overview;
